import React from "react";
import { Task } from "../../types/index";

interface todoArray {
  todo: Task[];
}
export const TodoList = ({ todo }: todoArray) => {
  return (
    <div className="item_list">
      {todo.length}
      {todo.map((item: Task, index: number) => (
        <div key={index}>{item}</div>
      ))}
    </div>
  );
};
